import { usePosts } from "../context/postContext"
import { useEffect } from "react"


export function HomePage() {

  const {getPosts,posts} = usePosts()

  useEffect(() => {
    getPosts()
  }, [])
  
  
  return (
    <div>
      <div>
        HomePage
      </div>
      <div className="text-white">
        {posts.map(post =>(
          <div key={post._id}>
            {post.title}
          </div>
        ))}
      </div>
    </div>
  )
}
